<script>
 
    const navigationData = [{
        htmlFileName:"long_purple.html",
        selectors: ['#Layer_1 > polygon.cls-26', '#Layer_1 > rect.cls-25', '#Layer_1 > polygon.cls-31']
    },{
        htmlFileName:"blue.html",
        selectors: ['#Layer_1 > polygon.cls-30', '#Layer_1 > rect.cls-17', '#Layer_1 > polygon.cls-29']
    },
    {
        htmlFileName:"yellow.html",
        selectors: ['#Layer_1 > polygon.cls-23', '#Layer_1 > rect.cls-22', '#Layer_1 > polygon.cls-24']
    },{
        htmlFileName:"orange.html",
        selectors: ['#Layer_1 > polygon.cls-33', '#Layer_1 > rect.cls-32']
    },{
        htmlFileName:"short_purple.html",
        selectors: ['#Layer_1 > polygon.cls-13', '#Layer_1 > rect.cls-15', '#Layer_1 > polygon.cls-27']
    },{
        htmlFileName:"red.html",
        selectors: ['#Layer_1 > polygon.cls-20', '#Layer_1 > rect.cls-21', '#Layer_1 > polygon.cls-19']
    },{
        htmlFileName:"green.html",
        selectors: ['#Layer_1 > polygon.cls-18', '#Layer_1 > rect.cls-16', '#Layer_1 > polygon.cls-28']
    }]
    navigationData.forEach(item=>{
        item.selectors.forEach(selector=>{
            document.querySelector(selector).style.cursor = "pointer"
            document.querySelector(selector).style.opacity = "0.9"
            document.querySelector(selector).onmouseover = () => {
                item.selectors.forEach(selector=>{
                    document.querySelector(selector).style.opacity = "1"
                })
            }
            document.querySelector(selector).onmouseleave = () => {
                item.selectors.forEach(selector=>{
                    document.querySelector(selector).style.opacity = ".9"
                })
            }
            document.querySelector(selector).onclick = () => {
                window.location.href = window.location.href.replace(window.location.href.split("/").slice(-1), item.htmlFileName)
            }
        })
    })

</script>
